import React, {useState} from 'react'
import {Tabs, Tab} from "react-bootstrap";
import './AlgoTab.css'


const AlgoTab = (props) => {
    const [eventKey, setEventkey] = useState('')
  //sets current algorithm tab
    const eventKeyHandler = (key) => {
        console.log('keyk', key)
        let tabKey = this.state.key
        tabKey = key

        this.setState({
        key: tabKey
        })
    }

    return (
        <div class='Tab'>
        <Tabs
            id="controlled-tab-example"
            activeKey={props.key}
            onSelect={event => eventKeyHandler(event)}
          >
            <Tab eventKey="Graph" title="Graph">
            </Tab>
            <Tab eventKey="Tree" title="Tree">
            </Tab>
            <Tab eventKey="LinkedList" title="Linked List">
            </Tab>
          </Tabs>
        </div>
    )
}

export default AlgoTab
